11.body:
A domain declaration. Properties: label: Required . A label for an entity visible in the document namespace. metadata: Metadata about this domain. The metadata is not used by Authly itself, but can be read and used by services. Example: [[domain]]
label = "cms"
metadata = { meta = "meta" }

7.body:
A service entity definition. Services are authenticated through client certificates rather than traditional credentials. Properties: eid: Required . The entity id. Service entity ids are prefixed by s.. label: A label for the entity visible in the document namespace. attributes: Attributes bound to the entity. See entity-attribute-assignment . metadata: Metadata about this entity. The metadata is not used by authly itself, but can be used by services which have read access to the entity. hosts: List of service hostnames. kubernetes-account: An optional Kubernetes account definition. Example: [[service-entity]]
eid = "s.3c2f40b3f47a4d9b9129b1e7c15fbc0c"
label = "service"
metadata = { meta = "meta" }
kubernetes-account = { name = "service", namespace = "myspace" }
